import React from 'react'
import Header from './Header';
import InfoBox from './InfoBox';
import "../node_modules/bootstrap/dist/css/bootstrap.min.css"
import "../node_modules/bootstrap/dist/js/bootstrap.bundle"
import Map from './Map'
import { Card, CardContent } from '@material-ui/core';


const App = () => {
    return (
        <div className="app  d-flex justify-content-evenly">
            <div className="app_left">
                <Header />

                <div className="app_status d-flex justify-content-between">
                    <InfoBox title="Coronavirus Cases" cases={2000} total={1.2} />
                    <InfoBox title="Recovered" cases={2000} total={1.2} />
                    <InfoBox title="Deaths" cases={2000} total={1.2} />
                </div>
                {/* Map */}
                <Map />
            </div>
            <Card className="app_right">
                <CardContent>    {/*Cardcontent give us nice white background area   */}
                <h3>Live Cases by Country</h3>
                <h3>Worldwide new Cases</h3>
                    {/* table */}
                    {/* Graph */}
                </CardContent>

            </Card>



        </div>

    )
}

export default App
